import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
  questionControl: {
    display: "block",
    marginBottom: "30px"
  },
  questionInput: {
    marginBottom: "20px"
  },
  blockBtn: {
    display: "block",
    marginTop: "30px"
  }
}));
